import Layout from '../../../components/layout'
import withAdmin from '../../withAdmin'

const Create = () => {
    return (
        <Layout>
            <div className="row">
                <div className="col=md-5 offset-md-3">
                    <h1>Create category</h1>
                    <br />
                </div>
            </div>
        </Layout>
    )
};

export default Create;
